Computer Architecture Question. Parallelize CG-algorithm (conjugate gradient algorithm) Answer. implement with #pragma omp parallel for etc.. Computer Architecture Question. Use MPI to distribute the following program & compare the elapsed time for each Number of Processes. #define N 16 * 1024
int i, j;
double x[N] = {...};
double sum = 0.0;
for (i = 0; i < N; ++i) { for (j = 0; j < N; ++j) { sum += (x[i] - x[j]) * (x[i] - x[j]); }
} Answer. i . pass whole of array x to the every process ii . in each process, calculate distributed task iii . aggregate the partial sum from every process but process-0 to sum in the process-0 #define N 16 * 1024
int i, j, np;
double x[N] = {...};
double sum = 0.0;
double psum;
MPI_Status status;
MPI_Init(&argc, &argv);
MPI_Comm_rank(MPI_COMM_WORLD, &myid);
MPI_Comm_size(MPI_COMM_WORLD, &np); sum=0.0;
if (myid == 0) { // send x to the each process for (i = 1; i < np; ++i) MPI_Send(&x, N, MPI_DOUBLE, i, 0, MPI_COMM_WORLD); // process the distributed task for (i = 0; i < N/np; ++i) { for (j = 0; j < N; ++j) { sum += (x[i] - x[j]) * (x[i] - x[j]); } } // aggregate for (i = 1; i < np; ++i) { MPI_Recv(&psum, 1, MPI_DOUBLE, i, 0, MPI_COMM_WORLD, &status); sum += psum; } // output printf("result: %lf\n", sum);
} else { // receive x MPI_Recv(&x, N, MPI_DOUBLE, 0, 0, MPI_COMM_WORLD, &status); // process the distributed task for (i = N/np * myid; i < N/np * (myid+1); ++i) { for (j = 0; j < N; ++j) { sum += (x[i] - x[j]) * (x[i] - x[j]); } } // send the partial sum MPI_Send(&sum, 1, MPI_DOUBLE, 0, 0, MPI_COMM_WORLD);
} MPI_Finalize(); Time Complexity Analysis: $$ O(\frac{L^2}{N} + LN) $$ where \(L\) is the size of x, \(N\) is the number of processes. \(O(\frac{L^2}{N})\) : Distributed Processing \(O(LN)\) : Message passing

